def mobius_function(n):
    """"""
    prime_factors = set()
    p = 2
    while n > 1 and p <= n ** 0.5:
        while n % p == 0:
            if p in prime_factors:
                return 0
            prime_factors.add(p)
            n //= p
        p += 1 + (p != 2)
    return (-1) ** ((len(prime_factors) + (n != 1)) % 2)
